package com.csejnu.diary.Model;import java.util.ArrayList;import java.util.List;public class Onushod {    String name;    List<Department> onushodList = new ArrayList<>();    public Onushod(String name, List<Department> onushodList) {        this.name = name;        this.onushodList = onushodList;    }    public String getName() {        return name;    }    public void setName(String name) {        this.name = name;    }    public List<Department> getOnushodList() {        return onushodList;    }    public void setOnushodList(List<Department> onushodList) {        this.onushodList = onushodList;    }}